    return (
      <div className="post">
        <div className="image">
            <img src={item.location}></img>
        </div>
        <div className="bottom">
            <div className = "username">
              {item.poster}
            </div>
            <div className = "ptext">
              {item.posttext}
            </div>
            <div className ="likes">
              {item.likes}
            </div>
            <div className ="comments">
              {comments.map(cm => comment(cm))}
            </div>
        </div>
      </div>
    );
  }

export default postFeed;
